import { Card, Input, TabsProps, Form, Button, Tabs, Row, Col } from "antd";

const Login = () => {
  const signin = (element: any) => {
    console.log(element);
  };
  const signup = (element: any) => {
    console.log(element);
  };
  const onChange = (key: string) => {
    console.log(key);
  };
  const items: TabsProps["items"] = [
    {
      key: "1",
      label: `Login`,
      children: (
        <div>
          <Form layout="vertical" onFinish={signin}>
          <Row gutter={[12, 6]}>
              <Col span={24}>
                <Form.Item name="username" label="Username">
                  <Input placeholder="Username" />
                </Form.Item>
              </Col>
              <Col span={24}>
                <Form.Item name="password" label="Password">
                  <Input placeholder="Password"  type="password"/>
                </Form.Item>
              </Col>
            </Row>
            <Button htmlType="submit">Login</Button>
            <Button>Back</Button>
          </Form>
        </div>
      ),
    },
    {
      key: "2",
      label: `Sign up`,
      children: (
        <div>
          <Form layout="vertical" onFinish={signup}>
            <Row gutter={[12, 6]}>
              <Col span={24}>
                <Form.Item name="username" label="Username">
                  <Input placeholder="Username" />
                </Form.Item>
              </Col>
              <Col span={12}>
                <Form.Item name="firstname" label="Firstname">
                  <Input placeholder="Firstname"  />
                </Form.Item>
              </Col>
              <Col span={12}>
                <Form.Item name="surname" label="Surname">
                  <Input placeholder="Surname"  />
                </Form.Item>
              </Col>
              <Col span={24}>
                <Form.Item name="password" label="Password">
                  <Input placeholder="Password"  type="password"/>
                </Form.Item>
              </Col>
            </Row>

            <Button htmlType="submit">Login</Button>
            <Button>Back</Button>
          </Form>
        </div>
      ),
    },
  ];
  return (
    <div className="bg-[#F9ECCE] w-[100%] h-[100vh] ">
      <div className="px-[50vh]  !content-center">
        <Tabs defaultActiveKey="1" items={items} onChange={onChange} />
      </div>
    </div>
  );
};
export default Login;
